(20, 'testUnwrapQuotes_emptyString', 'val original = \"\"\r\n        val expected = \"\"\r\n        val unquoted = original.unwrapQuotes()\r\n        assertEquals(expected, unquoted)', 8, 1, NULL, '2019-02-27 08:57:46', '2019-02-27 08:57:46', NULL),
